import React, { Component } from 'react';
import {Figure} from 'react-bootstrap/';
import '../App.css';

const profile_pic = require('../img/profile_pic.png');



class LeftSideBar extends Component {
  render() {
    return (
        <div  display= "flex"
         justify-content= "center">
                <Figure.Image
                    width={171}
                    height={180}
                    alt="171x180"
                    src={profile_pic}
                    roundedCircle
                />
                <Figure.Caption>
                    <p><b>Aijaz Ali</b></p>
                    <p>Karachi, PAK</p>
                </Figure.Caption>
      </div>
    )
  }
}

export default LeftSideBar;
